import React from "react";
class UploadSong extends React.Component {
  state = {};
  boxStyle = {
    position: "relative",
    width: "872px",
    height: "629px",
    background: "#050516"
  };
  innerBoxStyle = {
    position: "absolute",
    width: "650px",
    height: "300px",
    left: "111px",
    top: "165px"
  };
  iconStyle = {
    position: "absolute",
    left: "46%",
    right: "46%",
    top: "29.33%",
    bottom: "52.33%",

    fontFamily: "FontAwesome",
    fontStyle: "normal",
    fontWeight: "normal",
    fontSize: "48px",
    lineHeight: "55px",

    color: "#FFFFFF",

    opacity: "0.5"
  };

  render() {
    return (
      <div style={this.boxStyle}>
        <div style={this.innerBoxStyle}>
          <div style={this.iconStyle}>
            <img src="upload song.svg" />
          </div>
        </div>
      </div>
    );
  }
}

export default UploadSong;
